var body_class = $(".body-class");
var luein_mobile_nav_bar_container = $(".luein-mobile-nav-bar-container")
function open_close_lmnb() {
    var x = document.getElementById("ltnb-header");
    if (x.className === "ltnb-header") {
        x.className += " responsive";
        body_class.addClass("modal-open");
        luein_mobile_nav_bar_container.css({'width':'100%'})

    } else {
        x.className = "ltnb-header";
        body_class.removeClass('modal-open');
        luein_mobile_nav_bar_container.css({'width':''})
    }
}



