var ltnb_logout_div__ltnb_a = $(".ltnb-logout-div .ltnb-a")
var ltnb_logout_div_container = $(".ltnb-logout-div-container")

ltnb_logout_div__ltnb_a.click(function(){
    ltnb_logout_div__ltnb_a_fn();
})

function ltnb_logout_div__ltnb_a_fn(){
    if(ltnb_logout_div__ltnb_a.hasClass('s')){
        ltnb_avtr_detail_close();
    }
    else{
        ltnb_avtr_detail_open();
    }
}

function ltnb_avtr_detail_open(){
    ltnb_logout_div__ltnb_a.addClass('s');
    ltnb_logout_div_container.addClass('s');

    ltnb_logout_div_container.css({'visibility': 'visible'});
    if(check_logout_state == 'm'){
        ltnb_logout_div_container.css({'width':'100%'})
    }
    else{
        ltnb_logout_div_container.css({'width':''})
    }

    $(document).bind("mouseup.ltnb", function(e)
    {
        // if the target of the click isn't the container nor a descendant of the container
        if (!ltnb_logout_div__ltnb_a.is(e.target) && ltnb_logout_div__ltnb_a.has(e.target).length === 0)
        {
            ltnb_avtr_detail_close();
        }
    });
}
function ltnb_avtr_detail_close(){
    ltnb_logout_div__ltnb_a.removeClass('s');
    ltnb_logout_div_container.removeClass('s');

    ltnb_logout_div_container.css({'visibility': 'hidden'});
    $(document).unbind('mouseup.ltnb');
    ltnb_logout_div__ltnb_a.removeClass('s');
    ltnb_logout_div_container.removeClass('s');

    if(check_logout_state == 'm'){
        ltnb_logout_div_container.css({'width':'0%'})
    }
    else{
        ltnb_logout_div_container.css({'width':''})
    }
}

//@media screen for top nav bar avtar container check start
var check_logout_state = '';
function check_media_query_fn(x) {
    if (x.matches) { // If media query matches
        check_logout_state = 'm';
        if(ltnb_logout_div_container.hasClass('s')){
            ltnb_logout_div_container.css({'width':'100%'})
        }
    } else {
        check_logout_state = 'd';
        if(ltnb_logout_div_container.hasClass('s')){
            ltnb_logout_div_container.css({'width':''})
        }
    }
}
var x = window.matchMedia("(max-width: 768px)")
check_media_query_fn(x) // Call listener function at run time
x.addListener(check_media_query_fn) // Attach listener function on state changes
//@media screen for top nav bar avtar container check end
